const Audio = this.getDBM().Audio;
const id = server.id;

if(Audio.queue[id].length > 0) {
   const left = Audio.queue[id].length - 1;
   msg.channel.send('⏩ Okay. Skipped Song! (' + left + ' songs remaining)');
} else {
   msg.channel.send('❔ This is the last song! Use `!stop` to stop the song.');
}

